import React from 'react'
import './Functionalities.css'

export default function Functionalities() {
  return (
    <section className='section grey'>
        <p>Avec notre produit, vous pourrez floutter n'importe quelle image en un seul clic.</p>
        <Checkbox
            {...label}
            defaultChecked
            sx={{
                color: pink[800],
                '&.Mui-checked': {
                color: pink[600],
                },
            }}
        />
        <img src="/Images/lion.jpeg" alt="" />
    </section>
  )
}
